                        </TextContainer>
                    </AboutMe>
                    <Gear>
                        <TextContainer>
                            <p>Du text</p>
                        </TextContainer>
                    </Gear>
                </MainContent>
            </Parallax>
        </AboutContainer>
    )
}

export default About;
